Queries
When listening to paths, it is possible to modify the query with any of Firebase's included query methods. Below are examples using Firebase query methods as well as other methods that are included (such as 'populate').
orderByChild
To order the query by a child within each object, user orderByChild.
Example
Ordering a list of todos by the text parameter of the todo item (placing them in alphabetical order).
@firebaseConnect([
  '/todos#orderByChild=text'
])

orderByKey
Order a list by the key of each item. Since push keys contain time, this is also a way of ordering by when items were created.
Example
Ordering a list of todos based on their key (puts them in order of when they were created)
@firebaseConnect([
  '/todos#orderByKey'
])

orderByValue
Runs Firebase's orderByValue
Order a list by the value of each object
Example
Ordering a list of score's based on score's value
@firebaseConnect([
  `scores#orderByValue`
])

orderByPriority
Runs Firebase's orderByPriority
Example
Ordering a list based on priorities
@firebaseConnect([
  `scores#orderByPriority`
])

limitToFirst
Limit query results to the first n number of results
Examples

Displaying only the first todo item
@firebaseConnect([
 '/todos#limitToFirst'
])


Displaying only the first 10 todo items
@firebaseConnect([
 '/todos#limitToFirst=10'
])



limitToLast
Limit query results to the last n number of results
Examples

Only the last todo item
@firebaseConnect([
 '/todos#limitToFirst'
])


Only the last 10 todo items
@firebaseConnect([
 '/todos#limitToFirst=10'
])



startAt
Limit query results to include a range starting at a specific number
Example

Starting at the fifth item@firebaseConnect([
 'todos#startAt=5&limitToFirst=2'
])


Paginate results@firebaseConnect([
 'todos#startAt=5&limitToFirst=10'
])



endAt
@firebaseConnect([
  'todos#orderByChild=added&startAt=1&endAt=5'
])

equalTo
@firebaseConnect([
  'todos#orderByChild=added&startAt=5&limitToFirst=2'
])

Once
To load a firebase location once instead of binding, the once option can be used:
@firebaseConnect([
  { type: 'once', path: '/todos' }
])

Populate 
Populate allows you to replace IDs within your data with other data from Firebase. This is very useful when trying to keep your data flat. Some would call it a join, but it was modeled after the mongo populate method.
Visit Populate Section for full documentation.

docs/populate.html.body:
Populate
Populate allows you to replace IDs within your data with other data from Firebase. This is very useful when trying to keep your data flat. Some would call it a join, but it was modeled after the mongo populate method.
List of todo items where todo item can contain an owner parameter which is a user's UID like so:
{ text: 'Some Todo Item', owner: "Iq5b0qK2NtgggT6U3bU6iZRGyma2" }

Populate allows you to replace the owner parameter with another value on Firebase under that key. That value you can be a string (number and boolean treated as string), or an object
Example Data
todos: {
  123: {
    text: 'Some Todo Item',
    owner: "Iq5b0qK2NtgggT6U3bU6iZRGyma2"
   }
 }
 displayNames: {
   Iq5b0qK2NtgggT6U3bU6iZRGyma2: 'Scott Prue',
   6Ra53mf3U9Qmdwah6rXBMgY8smu1: 'Rick Sanchez'
 }
 users: {
   Iq5b0qK2NtgggT6U3bU6iZRGyma2: {
     displayName: 'Scott Prue',
     email: 'scott@prue.io'
   },
   6Ra53mf3U9Qmdwah6rXBMgY8smu1: {
     displayName: 'Rick Sanchez',
     email: 'rick@email.com'
   }
 }

String, Number, or Boolean
When trying to replace the owner parameter with a string such as a displayName from a /displayNames root follow the pattern of #populate=paramToPopulate:populateRoot.
Example Query
@firebaseConnect([
  { path: '/todos', populates: [{ child: 'owner', root: 'displayNames' }] }
  // '/todos#populate=owner:displayNames', // equivalent string notation
 ])

Result
123: {
  text: 'Some Todo Item',
  owner: 'Scott Prue'
 }

Object
Population can also be used to populate a parameter with an object. An example of this would be populating the owner parameter, which is an ID, with the matching key from the users list.
Example Query
@firebaseConnect([
  { path: '/todos', populates: [{ child: 'owner', root: 'users' }] }
  // '/todos#populate=owner:users' // equivalent string notation
 ])

Example Result
123: {
  text: 'Some Todo Item',
  owner: {
    displayName: 'Scott Prue',
    email: 'scott@prue.io'
  }
}

Object's Parameter
There is also the option to load a parameter from within a population object. An example of this could be populating the owner parameter with the displayName property of the user with a matching ID:
Example Query
@firebaseConnect([
 {
   path: '/todos',
   populates: [
     { child: 'owner', root: 'users', childParam: 'email' }
   ]
 }
 // '/todos#populate=owner:users:email' // equivalent string notation
])

Example Result
123: {
  text: 'Some Todo Item',
  owner: 'scott@prue.io'
}

